import './ExpenseItem.css';
function ExpenseComponent() {
  return (
    <div className='expense-item'>
      <div>31/05/1998 &emsp;&emsp;&emsp;&emsp;&emsp;</div>
      <div className='expense-item__description'> <h2>&emsp;car</h2></div>
      <div className='expense-item__price '>224</div>
    </div>
  );
}
export default ExpenseComponent;
